import React, { useState } from "react";
import axios from 'axios';
import logo from "../logoB.png"
import { useNavigate } from "react-router-dom";
import { useTabIndex } from 'react-tabindex';


export const Cabecera = () => {
    const navigate = useNavigate();

    const CerrarSesion = ()=> {
        console.log("cerrar sesion")
        localStorage.removeItem('user');
        navigate("/");
    }

    return (
    <div>
        <nav className="navbar navbar-expand-lg colorBg  ">


            <div className="container-fluid bg-body-tertiary">
                <button className="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarNavAltMarkup" aria-controls="navbarNavAltMarkup" aria-expanded="false" aria-label="Toggle navigation">
                    <span className="navbar-toggler-icon"></span>
                </button>
                <div className=" navbar-collapse collapse  " id="navbarNavAltMarkup">
                    <div className="navbar-nav ">
                        <a className="nav-link  text-white cabeceraMar" href="/explorador">Explorador</a>
                        <a className="nav-link text-white cabeceraMar" href={`/areaPersonal/${localStorage.getItem('user')}`}>Area Personal</a>
                        <a className="nav-link text-white" href={`/crearReceta`}>Crear Receta</a>
                    </div>
                </div>
                <img src={logo} className="fotoCabecera cabeceraMar alt" />  
                <button onClick={CerrarSesion} className="link-btn text-white buttonEdit "  >Cerrar sesion</button>

            </div>
        </nav>
        </div>
    )
}
